'Review your settings'=>'Granska dina inställningar',
'GetStartedSettings'=>'Post Affiliate Pro är gjort så att det ska fungera med standardkonfiguration.<br/> Du bör dock kontrollera konfigurationen och finjustera den för dina egna behov <br/> Du kan hitta konfigurationsskärmen under <strong> Konfig & Verktygsmenyn -> Konfiguration </ strong> <br/> <br /> En detaljerad beskrivning av alla konfigurationsalternativ finns i användarhandboken eller i kunskapsbasen.',
'Define your commissions'=>'Definiera din provision',
'GetStartedCommissions'=>'"En standardkampanj skapas under installationen. Du kan modifiera den, eller skapa egna kampanjer.<br/><br/>
Kampanjer används för att gruppera en uppsättning produkter (eller bara en produkt) som har samma provisionsinställningar.<br/><br/>
Till exempel kan du ha enkampanj för Produkt 1 där du belönar dina affiliates per klick, och en annan kampanj för Produkt 2, där affiliaten får provision per försäljning.<br/><br/>
Eller så kan du ha kampanj kallad billiga produkter, som kommer att ha 40% i provision per sälj, och en annan kampanj kallad dyra produkter med 15% i provision per sälj.<br/><br/><a href=\'http://www.qualityunit.com/postaffiliatepro/services/integration/\' target=\'_blank\'>Do you need help with configuration of commissions structure?</a>
',
'Add banners and other creatives'=>'Lägg till banners och andra annonser',
'GetStartedCreatives'=>'I <strong>Banners manager</strong> can du variera dig med textlänkar, banners i standard bild till HTML, Flash och promo email banners.<br/> Alla banners måste riktas till en specifik URL – den URL som kunden kommer till efter ett klick.<br/><br/><a href=\'http://www.qualityunit.com/postaffiliatepro/services/webdesign/\' target=\'_blank\'>Do you need help with banners development?</a>',
'Set up emails'=>'Ställ in e-post',
'GetStartedEmails'=>'Du bör ställa in e-post funktionalitet. Detta inkluderar: <ul><li><strong>mail account</strong> - hur e-postmeddelanden skickas. Du kan välja antingen mailfunktion () eller SMTP-server.</li><li><strong>email templates</strong> - dessa mallar används när systemet skickar automatiskt mail, som efter nyregistreringar eller köp. </li><li><strong>email notifications</strong> - du kan konfigurera vilken typ av meddelanden som du vill ha som manager, och vilka meddelanden som kommer att finnas tillgängliga för afilliates.</li></ul> Se till att mailontot är korrekt inställt - försök test skicka mail. Om inte email-funktionen är rätt kommer inte affiliates bli meddelande om sina registreringar, etc. ',
'Customize your affiliate signup form'=>'Anpassa hur dina affiliates registrerar sig',
'GetStartedSignupForm'=>'Kontrollera standard anmälningsformuläret, och anpassa det om du vill.<br/><br/>Anmälningsformuläret kommer med med enkel information som innehåller information om affiliate programmet, etc.<br/> Du kan välja att använda denna information eller enbart registreringsformuläret.<br/><br/><ahref=\'http://www.qualityunit.com/postaffiliatepro/services/webdesign/\' target=\'_blank\'>Do you need help with design customization?</a>',
