'Test everything'=>'Integration är ett sätt att ansluta affiliatesystemet till din nuvarande webbplats, kundvagn eller payment gateway på ett sätt som gör att affiliatesystemet kommer att underrättas om hänvisningar och köp.<br/> Affiliatesystemet registrerar försäljning, finner hänvisande affiliate (om någon finns) och skapar lämplig provision för honom/henne.<br/><br/>Integration betyder oftast att lägga in några rader med kod på dina sidor, och det beskrivs steg för steg i integrationsguideen för de vanligaste kundvagnarna och betalningssystemen<br/><br/><ahref=\'http://www.qualityunit.com/postaffiliatepro/services/integration/\' target=\'_blank\'>Do you need help with integration?</a ',
